"use strict";(self.webpackChunkmy_vuepress_site=self.webpackChunkmy_vuepress_site||[]).push([[669],{8822:(p,e,t)=>{t.r(e),t.d(e,{default:()=>r});var i=t(6252);const l=[(0,i.uE)("<p>12月5日，今天第一天军训，可惜没有充电动车，只得走了回去，找了老黄几次，他也没有充，果然求人不如求自己啊</p><p>11月10日，因为拖延导致青年大学习没有按时完成，我决心不拖延，布置的任务按时完成</p><p>11月11日，班上买火车票优惠卡，要7块钱，可我身上一分钱都没有，找舍友也没借到一分钱，京东金条、借呗、备用金都接不到钱，我第一次感受到了什么叫一分钱难倒英雄好汉，无可奈何之下选择了找爸妈要钱，老爸灵魂一问：7块钱都没有吗？我顿时哑口无言，才明白自己负债太高了，以后决不能再提前消费。</p><p>11月15日，花呗临时额度失效，瞬间连饭都吃不起，让我感到理财是多么重要，学会存钱才能掌握自己。</p><p>11月20日，连续吃了4天泡面，发现还有额度可以用，下定决心，以后再也不提前消费了，等还上贷款就关闭花呗、白条。</p><p>11月22日，没有用心答思修题，导致最后分数不高，让我知道了做事不能敷衍。</p><p>11月22日，我接触到了一个十分优秀的游戏，我一天打了7个小时，出色的打击手感，丰富感人且有深度的剧情，让我真正体会到了游戏的魅力，我又坚定了做中国3A单机的决心。</p><p>11月22日，手机借别人注册了一下，之后账号登不上去了，我苦思冥想半天，才弄好，终于知道管理好自己的账号是多么重要</p><p>11月23日，高数又收作业，逃过一劫，以后不能再这么狼狈了，一定要抽时间完成高数作业，对待学习要认真。</p><p>11月23日</p><p>2月8日，花呗终于还清了，还剩下京东白条了，以后再也不提前消费了，尤其是没有收入的时候</p><p>我、老黄、小胖约好了今天去吃自助餐。早上10点40就出门了，去了天一阁，肉的味道真是不错，饮料管够，62块钱也算物有所值。</p><ol><li>吃自助餐前不要吃东西</li><li>吃完饭不能剧烈运动</li><li>要记得随身带纸</li></ol>",13)],s={},r=(0,t(3744).Z)(s,[["render",function(p,e){return(0,i.wg)(),(0,i.iD)("div",null,l)}]])},2233:(p,e,t)=>{t.r(e),t.d(e,{data:()=>i});const i=JSON.parse('{"key":"v-3ee2649e","path":"/guide/22.%E7%94%9F%E6%B4%BB/%E6%97%A5%E8%AE%B0.html","title":"","lang":"en-US","frontmatter":{},"headers":[],"git":{},"filePathRelative":"guide/22.生活/日记.md"}')}}]);